INSERT INTO public.lesson_steps VALUES ('step-2', 'fuel-for-football', 2, 'true-false', 'Drinking water helps footballers play their best.', '{"feedback": "Yes! Even Cristiano Ronaldo is known for choosing water over fizzy drinks ‚Äî it keeps muscles working and the brain sharp.", "correctAnswer": true}', 10, 'sipping_water', '{"xp": {"firstTry": 10, "learnCard": 0, "secondTry": 5}, "messages": {"learnCard": "Without water, players slow down. Staying hydrated helps you play like the pros.", "tryAgain1": "Try again ‚Äî players drink water so they don''t slow down.", "tryAgain2": "Hint: the best choice keeps you cool and thinking clearly."}, "maxAttempts": 3}');
INSERT INTO public.lesson_steps VALUES ('step-3-brain', 'brainfuel-for-school', 3, 'matching', 'Match the food to what it gives your brain for school.', '{"feedback": "Omega-3: healthy brain cell membranes ‚Üí memory.\\nB vitamins: energy release ‚Üí concentration.\\nIron: oxygen supply ‚Üí less tiredness.\\nVitamin C: protection ‚Üí healthy function.", "matchingPairs": [{"left": "üß† Omega-3 fats", "right": "Supports memory & learning (cell membranes)"}, {"left": "‚ö° B vitamins", "right": "Helps release energy from food for focus"}, {"left": "ü©∏ Iron", "right": "Carries oxygen to the brain (clear thinking)"}, {"left": "üõ°Ô∏è Vitamin C", "right": "Helps protect cells (antioxidant)"}]}', 15, 'clipboard_tick', '{"xp": {"firstTry": 15, "learnCard": 0, "secondTry": 8}, "messages": {"learnCard": "Omega-3‚Üímemory; B vits‚Üíenergy release; Iron‚Üíoxygen; Vit C‚Üíprotection.", "tryAgain1": "Think energy, oxygen, memory, protection.", "tryAgain2": "Which one links to oxygen in blood?"}, "maxAttempts": 3}');
INSERT INTO public.lesson_steps VALUES ('step-2-brain', 'brainfuel-for-school', 2, 'true-false', 'Proteins are only for muscles, not the brain. True or false?', '{"feedback": "Right. Protein helps build/repair tissues and make brain messengers; healthy fats (e.g., omega-3) support cell membranes and memory.", "correctAnswer": false}', 10, 'brain_glow', '{"xp": {"firstTry": 10, "learnCard": 0, "secondTry": 5}, "messages": {"learnCard": "KS3 nutrition: protein = growth & repair; fats = energy/structures; both matter for brain function.", "tryAgain1": "Your brain also needs building blocks.", "tryAgain2": "Which choice recognises protein''s role beyond muscles?"}, "maxAttempts": 3}');
INSERT INTO public.lesson_steps VALUES ('step-4', 'fuel-for-football', 4, 'multiple-choice', 'Which of these is the best half-time snack to keep your energy up?', '{"options": [{"id": "banana", "text": "Banana", "emoji": "üçå", "correct": true}, {"id": "chocolate-bar", "text": "Chocolate bar", "emoji": "üç´", "correct": false}, {"id": "fizzy-drink", "text": "Fizzy drink", "emoji": "ü•§", "correct": false}], "feedback": "Spot on! Bananas give quick, clean energy. That''s why Kylian Mbapp√© often eats fruit to stay sharp in matches."}', 10, 'high_five', '{"xp": {"firstTry": 10, "learnCard": 0, "secondTry": 5}, "messages": {"learnCard": "Bananas = quick, clean energy. They keep you running in the second half like the pros.", "tryAgain1": "That''s a quick burst‚Ä¶ it fades fast. Pick one for the second half.", "tryAgain2": "Hint: choose the snack with clean energy for sprinting."}, "maxAttempts": 3}');
INSERT INTO public.lesson_steps VALUES ('step-4-brain', 'brainfuel-for-school', 4, 'multiple-choice', 'Exam in 1 hour. Best snack for sharp focus?', '{"options": [{"id": "chocolate-bar", "text": "Chocolate bar", "emoji": "üç´", "correct": false}, {"id": "banana-nuts", "text": "Banana + nuts", "emoji": "üçå", "correct": true}, {"id": "fizzy-drink", "text": "Fizzy drink", "emoji": "ü•§", "correct": false}, {"id": "crisps", "text": "Crisps", "emoji": "üçü", "correct": false}], "feedback": "Yes. Fruit + nuts give glucose + protein + minerals ‚Üí steady energy through the exam."}', 10, 'ready_sign', '{"xp": {"firstTry": 10, "learnCard": 0, "secondTry": 5}, "messages": {"learnCard": "Smart snacks blend carb + protein + vitamins (e.g., fruit+nuts, yogurt+berries).", "tryAgain1": "Some choices spike then crash. Which lasts longer?", "tryAgain2": "Pick the one that combines energy and nutrients."}, "maxAttempts": 3}');
INSERT INTO public.lesson_steps VALUES ('step-5-brain', 'brainfuel-for-school', 5, 'ordering', 'Put the steps in order to show how nutrients reach your brain.', '{"feedback": "Exactly. Most absorption happens in the small intestine; blood then delivers nutrients to the brain.", "orderingItems": [{"id": "chew-mouth", "text": "Chew food in the mouth", "correctOrder": 1}, {"id": "stomach-breakdown", "text": "Food broken down more in the stomach", "correctOrder": 2}, {"id": "small-intestine", "text": "Small intestine absorbs nutrients into blood", "correctOrder": 3}, {"id": "blood-transport", "text": "Nutrients travel in blood to brain & muscles", "correctOrder": 4}]}', 15, 'snack_pot', '{"xp": {"firstTry": 15, "learnCard": 0, "secondTry": 8}, "messages": {"learnCard": "Small intestine = main site of nutrient absorption into the bloodstream.", "tryAgain1": "Chew ‚Üí digest ‚Üí absorb ‚Üí transport.", "tryAgain2": "Which organ does the absorbing step?"}, "maxAttempts": 3}');
INSERT INTO public.lesson_steps VALUES ('step-6-brain', 'brainfuel-for-school', 6, 'multiple-choice', 'If you often skip breakfast, what''s most likely?', '{"options": [{"id": "tiredness-focus", "text": "Tiredness & poor focus", "emoji": "üí§", "correct": true}, {"id": "faster-running", "text": "Faster running speed", "emoji": "üèÉ", "correct": false}, {"id": "better-memory", "text": "Better memory", "emoji": "üéß", "correct": false}, {"id": "stronger-muscles", "text": "Stronger muscles", "emoji": "üí™", "correct": false}], "feedback": "Correct. Low morning glucose ‚Üí less concentration and slower thinking in lessons."}', 10, 'thumbs_up', '{"xp": {"firstTry": 10, "learnCard": 0, "secondTry": 5}, "messages": {"learnCard": "Breakfast = steady morning energy ‚Üí better attention and memory in class.", "tryAgain1": "Skipping meals rarely improves performance.", "tryAgain2": "What happens when the brain''s fuel runs low?"}, "maxAttempts": 3}');
INSERT INTO public.lesson_steps VALUES ('step-1-brain', 'brainfuel-for-school', 1, 'multiple-choice', 'Which food gives the most steady energy for study or revision?', '{"options": [{"id": "sweets", "text": "Sweets", "emoji": "üç¨", "correct": false}, {"id": "white-bread", "text": "White bread", "emoji": "üçû", "correct": false}, {"id": "brown-rice", "text": "Brown rice", "emoji": "üçö", "correct": true}, {"id": "fizzy-drink", "text": "Fizzy drink", "emoji": "ü•§", "correct": false}], "feedback": "Correct. Wholegrain carbs (like brown rice, oats, wholemeal pasta) release glucose slowly, keeping focus steady across a lesson."}', 10, 'graduation_cap', '{"xp": {"firstTry": 10, "learnCard": 0, "secondTry": 5}, "messages": {"learnCard": "The brain uses glucose. Wholegrains release it gradually ‚Üí fewer dips in focus.", "tryAgain1": "Think slow & steady fuel, not a quick burst.", "tryAgain2": "Which option keeps blood sugar stable through the lesson?"}, "maxAttempts": 3}');
INSERT INTO public.lesson_steps VALUES ('step-1', 'fuel-for-football', 1, 'multiple-choice', 'Before a football match, which food gives you the best long-lasting energy?', '{"options": [{"id": "sweets", "text": "Sweets", "emoji": "üç¨", "correct": false}, {"id": "white-bread", "text": "White bread", "emoji": "üçû", "correct": false}, {"id": "oats", "text": "Oats", "emoji": "ü•£", "correct": true}], "feedback": "Correct! Oats give slow-release energy so you don''t run out of steam ‚Äî just like Lionel Messi keeps moving all game."}', 10, 'holding_football', '{"xp": {"firstTry": 10, "learnCard": 0, "secondTry": 5}, "messages": {"learnCard": "Oats give steady energy. That''s why top players eat porridge before matches.", "tryAgain1": "Not quite ‚Äî think steady energy for the whole game.", "tryAgain2": "Almost! Which breakfast keeps you running past half-time?"}, "maxAttempts": 3}');
INSERT INTO public.lesson_steps VALUES ('step-5', 'fuel-for-football', 5, 'ordering', 'Put these foods in order to make a balanced footballer''s plate.', '{"feedback": "Nice! Pasta = energy, Yogurt = muscle repair, Broccoli = vitamins. That''s how players like Lucy Bronze and Neymar fuel before big games.", "orderingItems": [{"id": "pasta", "text": "Pasta", "correctOrder": 1}, {"id": "yogurt", "text": "Yogurt", "correctOrder": 2}, {"id": "broccoli", "text": "Broccoli", "correctOrder": 3}]}', 10, 'plate_builder', '{"xp": {"firstTry": 10, "learnCard": 0, "secondTry": 5}, "messages": {"learnCard": "Balanced plate: Pasta (energy), Yogurt (repair), Broccoli (health).", "tryAgain1": "Nearly ‚Äî start with energy, then repair, then vitamins.", "tryAgain2": "Think: carbs ‚Üí protein/dairy ‚Üí fruit/veg."}, "maxAttempts": 3}');
INSERT INTO public.lesson_steps VALUES ('step-3', 'fuel-for-football', 3, 'matching', 'Match the food to what it does for your body when playing football.', '{"feedback": "Oats = steady energy, like Erling Haaland powering through defenders.\\nYogurt = repairs muscles, like Alexia Putellas staying strong in midfield.\\nCrisps = tasty, but won''t fuel you like Sam Kerr sprinting for a goal.", "matchingPairs": [{"left": "ü•£ Oats", "right": "Long-lasting energy for running"}, {"left": "ü•õ Yogurt", "right": "Repairs muscles and strengthens bones"}, {"left": "üçü Crisps", "right": "Extra fat, not much help on the pitch"}]}', 15, 'juggling_football', '{"xp": {"firstTry": 15, "learnCard": 0, "secondTry": 8}, "messages": {"learnCard": "Correct matches: Oats ‚Üí energy, Yogurt ‚Üí muscles & bones, Crisps ‚Üí not much help.", "tryAgain1": "Some matches aren''t right ‚Äî think energy, repair, and ''not much help''.", "tryAgain2": "Check again: oats = energy. Which one repairs muscles and bones?"}, "maxAttempts": 3}');
INSERT INTO public.lesson_steps VALUES ('step-6', 'fuel-for-football', 6, 'multiple-choice', 'After a football match, eating protein helps your ______ recover.', '{"options": [{"id": "brain", "text": "Brain", "emoji": "üß†", "correct": false}, {"id": "muscles", "text": "Muscles", "emoji": "üí™", "correct": true}, {"id": "hair", "text": "Hair", "emoji": "üíá", "correct": false}], "feedback": "Exactly! Protein repairs muscles so you''re ready to train again ‚Äî just like Sam Kerr or Harry Kane preparing for the next match."}', 10, 'flexing', '{"xp": {"firstTry": 10, "learnCard": 0, "secondTry": 5}, "messages": {"learnCard": "Protein = muscle repair. That''s why players eat yogurt, eggs, or beans after matches.", "tryAgain1": "Think about what works hardest in football.", "tryAgain2": "Hint: protein helps the part that kicks, runs, and jumps."}, "maxAttempts": 3}');
